he National are a Brooklyn-based indie rock band formed in Cincinnati, Ohio in 1999. The band's lyrics are written and sung by Matt Berninger in a distinctive, deep baritone. The rest of the band is composed of two pairs of brothers: Aaron and Bryce Dessner and Scott and Bryan Devendorf. Aaron plays guitar, bass and piano, Bryce plays guitar, Scott plays bass and guitar, and Bryan is the drummer. Padma Newsome, from sister band Clogs, often contributes strings, keyboards, and other arrangements and instrumental flourishes. Influences range from Bruce Springsteen to Joy Division.
